window.bookSummaryJSON = "<p>In the world of Re:Fuze, anything is possible. Fortunes can be made, and the unlikeliest of people can find glory in a land of swords and magic. </p> <p>With low Job Qualification (JQ) scores and two years of national service looming, Eric Templeton knows he is doomed to a life of poverty. When he is given a chance to enter the game, he knows he has the opportunity to save his family from their desperate situation. </p> <p>But when he enters the game, Eric isn't spawned into the newbie camp of Blundow. Instead he is sent to the darkest regions of the map, filled with creatures beyond his level. He stumbles across a conspiracy that no newbie should ever see, and he knows that he can't hope to survive. </p>"; 
